/// Important: Language identifiers must follow the hyphenated format specification, e.g.: <code>zh-Hans</code>
///
/// </blockquote>
/// <ul>
///   <li>
///     Part1: Language code (ISO 639-1) - Two letters identifying the base language (e.g., “zh” for Chinese)
///   </li>
