/// | Parameter        | Specification                                                      |
/// |—————–|——————————————————————|
/// | SampleRate      | 16000.0f                                                          |
/// | FormatID        | LinearPCM                                                         |
/// | FormatFlags     | kLinearPCMFormatFlagIsSignedInteger, kLinearPCMFormatFlagIsPacked|
/// | FramesPerPacket | 1                                                                  |
/// | ChannelsPerFrame| 1                                                                  |
/// | BitsPerChannel  | 16                                                                |
